import React, { useState, useEffect } from "react";
import api from "../api";

export default function ProductForm({ product, onClose, onImportSuccess }) {
  const [mode, setMode] = useState("single"); // single: 單筆, csv: CSV匯入
  const [form, setForm] = useState({
    name: "",
    code: "",
    unit: "",
    price: "",
    quantity: "",
  });
  const [csvFile, setCsvFile] = useState(null);

  useEffect(() => {
    if (product && mode === "single") {
      setForm({
        name: product.name || "",
        code: product.code || "",
        unit: product.unit || "",
        price: product.price || "",
        quantity: product.quantity || "",
      });
    } else {
      setForm({
        name: "",
        code: "",
        unit: "",
        price: "",
        quantity: "",
      });
    }
  }, [product, mode]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleCsvChange = (e) => {
    setCsvFile(e.target.files[0]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (mode === "single") {
        if (product) {
          await api.put(`inventory/products/${product.id}/`, form);
        } else {
          await api.post("inventory/products/", form);
        }
        onClose();
      } else if (mode === "csv" && csvFile) {
        const data = new FormData();
        data.append("file", csvFile);
        await api.post("inventory/products/import-csv/", data, {
          headers: { "Content-Type": "multipart/form-data" },
        });
        onImportSuccess?.();
        onClose();
      }
    } catch (err) {
      alert(err.response?.data?.error || "操作失敗");
    }
  };

  return (
    <div style={{ border: "1px solid #ccc", padding: "16px", marginBottom: "16px" }}>
      <div style={{ marginBottom: "16px" }}>
        <button type="button" onClick={() => setMode("single")} style={{ marginRight: "8px" }}>
          單筆新增
        </button>
        <button type="button" onClick={() => setMode("csv")}>CSV匯入</button>
      </div>

      {mode === "single" ? (
        <form onSubmit={handleSubmit}>
          <input
            name="name"
            placeholder="名稱"
            value={form.name}
            onChange={handleChange}
            required
            style={{ display: "block", marginBottom: "8px" }}
          />
          <input
            name="code"
            placeholder="代碼"
            value={form.code}
            onChange={handleChange}
            style={{ display: "block", marginBottom: "8px" }}
          />
          <input
            name="unit"
            placeholder="單位"
            value={form.unit}
            onChange={handleChange}
            style={{ display: "block", marginBottom: "8px" }}
          />
          <input
            name="price"
            placeholder="價格"
            value={form.price}
            onChange={handleChange}
            style={{ display: "block", marginBottom: "8px" }}
          />
          <input
            name="quantity"
            placeholder="庫存"
            value={form.quantity}
            onChange={handleChange}
            style={{ display: "block", marginBottom: "8px" }}
          />
          <button type="submit" style={{ marginRight: "8px" }}>
            {product ? "更新" : "新增"}
          </button>
          <button type="button" onClick={onClose}>
            取消
          </button>
        </form>
      ) : (
        <form onSubmit={handleSubmit}>
          <input type="file" accept=".csv" onChange={handleCsvChange} style={{ marginBottom: "8px" }} />
          <button type="submit" style={{ marginRight: "8px" }}>匯入</button>
          <button type="button" onClick={onClose}>取消</button>
        </form>
      )}
    </div>
  );
}
